import React from 'react';
import { StyleSheet } from 'react-native';
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
import { HomeTab, NotificationTab, MessageTab, InboxTab, AvatarTab } from './'

const Tab = createMaterialBottomTabNavigator();


const TabNavigators = () => {
    return (
        <Tab.Navigator>
            <Tab.Screen name="avatar" component={HomeTab} />
            <Tab.Screen name="Settings" component={NotificationTab} />
            <Tab.Screen name="Settings" component={MessageTab} />
            <Tab.Screen name="Settings" component={InboxTab} />
            <Tab.Screen name="Settings" component={AvatarTab} />
        </Tab.Navigator>
    );
}

const styles = StyleSheet.create({})

export default TabNavigators;
